import React from "react";

function PageLinks({ parentClass, itemClass }) {
  return (
    <ul className={parentClass}>
      <li>
        <a href="#home" className={itemClass}>
          <i className="fa-solid fa-house"></i>Home
        </a>
      </li>
    </ul>
  );
}

export default PageLinks;
